class MockScope(Scope):
    def __init__(self):
        super().__init__()
        self.trigger_count = 0
        self.pulse_timeout = -1

    def get_resource(self):
        return MockResource()

    MOCK_TIMEOUT = 11  # sec.

    def trigger_active(self):
        res = True

        if self.trigger_count == 3:
            if self.pulse_timeout < 0:
                self.pulse_timeout = time.time()

            res = time.time() - self.pulse_timeout > self.MOCK_TIMEOUT

        if res:
            self.trigger_count += 1
            self.pulse_timeout = -1

        return res


